import * as React from "react";
import {
  View,
  StyleProp,
  ViewStyle,
  Text,
  StyleSheet,
  ImageBackground,
  Pressable,
  TouchableOpacity,
} from "react-native";
import Tabs from 'react-native-tabs';
import { useNavigation } from "@react-navigation/native";
import { Color, FontSize, FontFamily, Border, Padding } from "../GlobalStyles";
import PostTab from "./LikeTab";

const Destyevents1 = ({ style }) => {
  const navigation = useNavigation();

  return (
    <View style={[styles.destyevents, style]}>
      <View style={styles.topicTimeFlexBox}>
        <Text style={styles.destyEvents}>Desty events</Text>
        <Text style={[styles.hrAgo, styles.hrAgoTypo]}>2hr ago</Text>
      </View>
      <View style={[styles.userProfile, styles.topicTimeFlexBox]}>
        <ImageBackground
          style={styles.whatsappImage20230118At1}
          resizeMode="cover"
          source={require("../assets/whatsappimage20230118at1101.png")}
        />
        <View style={styles.daysteriousParent}>
          <Text style={styles.destyEvents}>Daysterious</Text>
          <Text style={[styles.analyticalChemistry, styles.hrAgoTypo]}>
            Analytical chemistry
          </Text>
        </View>
      </View>
      <Pressable onPress={() => navigation.navigate("Post")} >
      <View style={[styles.message, styles.messageFlexBox]}>
        <Text style={styles.kamaKawaidaSherehe}
        >{`Kama kawaida sherehe ibada. I want to inform you, this coming 
friday all roads head to Siron pool party......you just cant miss
 this!!! Attending artists: mejja`}</Text>
      </View>
      </Pressable>
      <PostTab/>
    </View>
  );
};

const styles = StyleSheet.create({
  hrAgoTypo: {
    color: Color.gray_400,
    fontSize: 12,
    fontFamily: FontFamily.interMedium,
    fontWeight: "600",
    textAlign: "left",
  },
  topicTimeFlexBox: {
    alignItems: "center",
    flexDirection: "row",
  },
  messageFlexBox: {
    flexDirection: "row",
    marginTop: 5,
  },
  destyEvents: {
    fontSize: 15,
    fontWeight: "600",
    fontFamily: FontFamily.interSemibold,
    color: Color.black,
    textAlign: "left",
  },
  hrAgo: {
    marginLeft: 230,
  },
  whatsappImage20230118At1: {
    borderRadius: Border.br_81xl,
    width: 45,
    height: 45,
  },
  analyticalChemistry: {
    marginTop: 4,
  },
  daysteriousParent: {
    marginLeft: 6,
  },
  userProfile: {
    marginTop: 5,
  },
  kamaKawaidaSherehe: {
    fontSize: 14,
    color: Color.gray_500,
    fontFamily: FontFamily.interMedium,
    fontWeight: "500",
    textAlign: "left",
  },
  message: {
    paddingHorizontal: 0,
    paddingVertical: Padding.p_8xs,
    marginTop: 5,
  },
  simmu22Icon: {
    borderRadius: Border.br_3xs,
    width: 349,
    height: 158,
  },
  image: {
    padding: Padding.p_8xs,
    marginTop: 5,
  },
  customTopTabChild: {
    display: "none",
  },
  customTopTabItem: {
    marginLeft: 55,
    display: "none",
  },
  customTopTab: {
    alignItems: "flex-end",
    marginTop: 5,
  },
  destyevents: {
    borderRadius: Border.br_8xs,
    backgroundColor: Color.white,
    borderStyle: "solid",
    borderColor: "#e0e0e0",
    borderBottomWidth: 1,
    paddingHorizontal: Padding.p_5xs,
    paddingVertical: Padding.p_xs,
  },
});

export default Destyevents1;
